        <>
            <div class="container "  >
                <div class="row align-self-end">
                    <h1 className="text-center">Navigation</h1>
                </div>
                <div class="row align-self-end">
                    <button className="btn btn-success m-1">Products</button>
                    <button className="btn btn-warning m-1">Clients</button>
                    <button className="btn btn-primary m-1">Orders</button>
                </div>
            </div>
        </>
    );
};

export default NavigateButtons;
